rawText:
 ({
  native,
  textClassName,
  className,
  children,
}: NavType) => {
  const tailwind = useTailwind();
  const { style, ...nativeWithoutStyle } = native || {};
  const tailwindStyle = className ? tailwind(trimClassName(className)) : {};

  return (
    <View
      style={[
        tailwindStyle,
        style,
        {
          flexDirection: "row",
          alignItems: "center",
          elevation: 0,
        },
      ]}
      {...nativeWithoutStyle}
    >
      {wrapInTextIfNeeded(children, textClassName)}
    </View>
  );
}
